import SocialBox from "./box/SocialBox.social";

import React from 'react';

const Social = ()=> {

    return(
        <section className='socialSection'>
            <div className="boxesContainer">
                <SocialBox
                    icon = {fa}
                    social = {'Facebook'}
                />
                <SocialBox
                    icon = {faTwitter}
                    social = {'Twitter'}
                />
                <SocialBox
                    icon = {faLinkedin}
                    social = {'Linkedin'}
                />
            </div>
        </section>
    )

}


export default Social;
